# ----------------------------------------- Acquire Training Data Given URLs -----------------------------------------

def persist_images(url):
    """ 
    Scrape images from website and return PIL Image of that image 
    params: url of image to extract
    """
    if is_base64_encoded(url):
        pil_im = prepare_base64_image(url)
    elif url[:4] == 'http':
        pil_im = read_convert_image_from_url(url)
    return pil_im

def is_base64_encoded(data):
    # Base64 encoded images start with 'data:'
    return data[:5] == 'data:'


def prepare_base64_image(data):
    """ Prepate a base64 encode image to be saved. """
    # # Currently all images are JPEG
    # image_type = 'image/jpeg'
    # # From 'image/jpeg' to 'jpeg'
    # image_extension = image_type.replace('image/', '')
    if data[:5] == 'data:':
        # Data is like
        # "data:image/jpeg;base64,/9j/4AAQSkZJRgABAQAAAQABAAD..."
        # figure the image type and extension
        # image_type = data[data.find("data:"):data.find(";base64")].replace('data:', '')
        # image_extension = image_type.replace('image/', '')
        # The actual base64 encoded image
        data = data[data.find(",") + 1:]
    decoded_image = base64.b64decode(data)
    img_bytes = BytesIO(decoded_image)
    pil_im = convert_bytes_to_PIL(img_bytes)
    return pil_im


def convert_bytes_to_PIL(img_bytes):
    """ Convert an image (as BytesIO in-memory buffer) to PIL Image """
    # Rewind to beginning of buffer, so PIL can read it
    img_bytes.seek(0)
    # Open the image via PIL and read into a Numpy array
    pil_im = Image.open(img_bytes).convert('RGB')
    return pil_im


def read_convert_image_from_url(url):
    """ Read the image and convert it to PIL Image. """
    # Get the image as in memory file-like object
    response = requests.get(url, stream=True)
    img_bytes = BytesIO(response.content)
    return convert_bytes_to_PIL(img_bytes)
    

# ----------------------------------------- Generate Data for Torch Dataloader -----------------------------------------
class GImageDatasetLocal(Dataset):
    """
    PyTorch dataset which pulls datasets from Google Images, using local image scraping (NO DB implementation)
    """
    def __init__(self, inpt):
        """
        inpt = dictionary consisting keys which are urls of image and values which are 0 or 1, i.e. the ground truth class labels.
        """
        self.inpt = inpt
        self.urls = list(inpt.keys())
        
    def __len__(self):
        return len(self.urls)
    
    def __getitem__(self, idx):
        """
        idx: the idx^th element of the directory will be returned.
        """
        url = self.urls[idx]  # extract the idx^th url from the list of all urls
        im = persist_images(url)  # find the image from Google as a PIL image
        
        preprocess = transforms.Compose([transforms.Resize(256), transforms.CenterCrop(224), transforms.ToTensor(),
            transforms.Normalize(mean=[0.485, 0.456, 0.406], std=[0.229, 0.224, 0.225]),])
        inputTensor = preprocess(im)  # normalize data, resize it, crop it, and convert it to a Tensor
        
        if  self.inpt[url] == 0:  # ground truth label is class 0
            correct = torch.tensor(0.0, dtype=torch.long)
        else:  # ground truth label is class 1
            correct = torch.tensor(1.0, dtype=torch.long)
            
        sample = {"image": inputTensor, "class": correct}  # return the image and ground truth label
        return sample


def train(allurls, num_classes=2, num_epochs=100):
    """
    Train a ResNet50 given the urls of the web-scraped images.
    :param: allurls -- a list of 2-element tuples, where the first element is the url of the image, and the second element is the class label of 
    that image, ie, 0 for one of the classes and 1 for the other class.
    :param: num_classes -- number of classes you're trying to distinguish between (only 2 supported currently).
    :param: num_epochs -- number of epochs to train for (100 default)
    """

    # Define model:
    model = models.resnet50(pretrained=True)
    model.fc = nn.Linear(model.fc.in_features, num_classes)  # modify output layer to only have num_classes outputs
    device = torch.device("cuda:0" if torch.cuda.is_available() else "cpu")
    model = model.to(device)  # send model to GPU

    # Define optimizer and loss function:
    optimizer = optim.Adam(model.parameters())  # define SGD optimizer
    loss_fxn = nn.CrossEntropyLoss()

    # Set up Tensorboard logging to ./runs/:
    writer = SummaryWriter()
    
    # Split dataset into training (80%) and validation (20%) sets
    train = dict(allurls[:int(len(allurls)*0.8)])
    val = dict(allurls[int(len(allurls)*0.8):])

    trainingset = GImageDatasetLocal(train)  # take first 80% of data for training
    trainloader = DataLoader(trainingset, batch_size=4, shuffle=True, num_workers=2)

    validationset = GImageDatasetLocal(val)  # and remaining 20% for validation
    valloader = DataLoader(validationset, batch_size=1, shuffle=True, num_workers=2)

    # Training loop:
    print("Beginning training...")
    highest_val = 0.0  # keep track of model with highest validation accuracy so far
    model_name = datetime.today().strftime('%Y-%m-%d-%H:%M')
    for epoch in range(num_epochs):
        running_loss = 0.0
        for phase in ["val", "train"]:  # each epoch consists of a training and validation phase
            if phase == "train":
                model.train(True)
                loader = trainloader
            else:
                model.train(False)  # don't update the weights on validation phase
                loader = valloader
                num_correct = 0.
                
            for ibatch, data in enumerate(loader, 0):  # iterate through all mini-batches of data
                inputs = data["image"]  # batch size x 3 x image_height x image width
                correct_output = data["class"]
                inputs, correct_output = inputs.to(device), correct_output.to(device)  # send inputs and labels to the GPU
                optimizer.zero_grad()  # make sure gradients are zeroed
                actual_output = model(inputs)  # forward pass
                if phase == "train":
                    loss = loss_fxn(actual_output, correct_output)  # compute loss
                    loss.backward()  # backpropagate the loss
                    optimizer.step()  # update weights
                    writer.add_scalar('data/trainingloss', loss, ibatch)  # record loss in tensorboard
                    running_loss += loss.item()
                    
                # print statistics
                printevery = 200
                if (ibatch % printevery == printevery-1) and (phase == "train"):  # print loss every 200 mini-batches
                    print('[%d, %5d] loss: %.3f' % (epoch + 1, ibatch + 1, running_loss / printevery))
                    running_loss = 0.0
                    
                elif phase == "val" :
                    correct_idx = np.max(correct_output.cpu().detach().numpy())  # find the correct output
                    idx = np.argmax(actual_output.cpu().detach().numpy())  # find the actual output
                    if correct_idx == idx:
                        num_correct += 1.  # if model got it right, add 1
                    if ibatch == len(loader) - 1:  # only print val loss once, after all validation images have been tested
                        print("num correct, total", num_correct, len(loader))
                        val_accuracy = num_correct / len(loader)
                        print("val accuracy:", val_accuracy)
                        if val_accuracy > highest_val:  # if current model performs better than previous best-performing model
                            highest_val = val_accuracy
                            # save weights into ./models/ dir, overwrite old model file:
                            torch.save(model.state_dict(), './models/' + model_name)

    print("Finished Training!")
    

